import React, { useEffect, useState } from 'react';

const StationsList = ({ titulo, url }) => {

    const [station, setStation] = useState([]);
    const [fecha, setFecha] = useState([]);

    useEffect(() => {
        console.log(station);
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch(url);
        const stations = await data.json();
        setStation(stations.ListaEESSPrecio);
        setFecha(stations.Fecha)
    }

    return (
        <div>
            <h1>{titulo}</h1>
            <ul>
                {
                    station.map(item => (
                        <li key={item.Latitud}> {item['Rótulo']} {item['Dirección']} Localidad: {item.Localidad} Precio Gasóleo: {item['Precio Gasoleo A']}€ 
                        Precio Gasolina 95: {item['Precio Gasolina 95 E5']}€ 
                        Precio Gasolina 98: {item['Precio Gasolina 98 E5']}€ 
                        </li>
                    ))
                }
            </ul>
            <p>Fecha: {stations.Fecha}</p>
        </div>
    );
}

export default StationsList;
